import React from "react";
import Card from "../../UI/Card";
const CartSummary = ({totalPrice}) => {
  return (
    <React.Fragment>
      <h4>Summary</h4>
      <Card>
        <div className="border-small"></div>
        <div>
          <input
            type="text"
            className="couponCode"
            placeholder="Enter Coupon Code"
          />
          <div className="row">
            <h6>Subtotal</h6>
            <div className="total">{totalPrice}</div>
          </div>
          <div><h6>Shipping</h6></div>
          <div><h6>Taxes</h6></div>
        </div>
        <div className="border-small"></div>
        <div>Total</div>
      </Card>
    </React.Fragment>
  );
};

export default CartSummary;
